import shoppingList from "../data/data";
import List from "../components/List";
import "../css/main.css";

function Main() {
  return (
    <ul className="mainWrapper">
      { 
        shoppingList.map((item) => (
            <List  item={ item } key={ item.id } />
        )) 
      }
    </ul>
  );
};

export default Main;
